import React, { Component } from "react";
import {
MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBFormInline, MDBIcon
} from "mdbreact";
import { BrowserRouter as Router } from 'react-router-dom';

class NavBar extends Component {
state = {
  isOpen: false
};

toggleCollapse = () => {
  this.setState({ isOpen: !this.state.isOpen });
}

render() {
  return (
    <div className="container">
    <div className="row">
      <div className="col-md-12">
    <div className="inquiry-list">
      <p><MDBIcon far icon="comment-dots" /> Inquiry</p>
      <p className="float-right"><MDBIcon icon="user-tag" /> Feedback</p>
    </div>
    </div>
    </div>
  </div>


    
    );
  }
}

export default NavBar;
